import React from "react";
import { Button, Box, TextField, Stack, Container } from "@mui/material";
import "./index.css";

function Login() {
  return (
        <Stack spacing={3} sx={{background: "yellow"}}
        hintStyle={{ width: '600px', textAlign: 'center' }}>
          <TextField
            fullWidth
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField
          sx={{input: {textAlign: "center"}}}
            id="outlined-password-input"
            label="Password"
            type="password"
          />
          <Button fullWidth variant="contained">
            Login
          </Button>
        </Stack>
  );
}

export default Login;
